import Button from "./Button";
import { Fragment } from "react";

export default (props) => {
    return <Fragment>
        <h1>{props.q.title}</h1>
        <h2>{props.q.subtitle}</h2>
        {props.q.fields.map(field => {
            {
                field === "select" && field.options && <Fragment>
                    {field.options.map(f => <Button>{f.text}</Button>)}
                </Fragment>
            }
        })}
    </Fragment>
}
